			<div class="update-label">Last Updated</div>
			<div class="update-time">{{ lastUpdate }}</div>
		</div>
	</div>
</template>

<script>
import Map from "../components/Map.vue";
export default {
	components: {
		Map
	},
	data() {
		return {
			health: "healthy",
			error: null,
			info: null,
			hideUpload: false,
			source: null,
			sources: null,
			lastUpdate: null,
			adapter: "cli", // api , cli
			publicPath:
				process.env.NODE_ENV === "production" ? "/mauritius-sea-cable/" : "/"
		};
	},
	methods: {
		visibilityChange(evt, hidden) {
			// do something
			// console.log(hidden);
		},
		upload(value) {
			if (this.adapter == "cli") {
				return this.info
					? this.round(this.toBits(value.bandwidth), 2) + " Mb/s"
					: "0 Mb/s";
			} else {
				return this.round(value, 2) + " Mb/s";
			}
		},
		download(value) {
			if (this.adapter == "cli") {
				return this.info
					? this.round(this.toBits(value.bandwidth), 2) + " Mb/s"
					: "0 Mb/s";
			} else {
				return this.round(value, 2) + " Mb/s";
			}
		},
		ping(value) {
			if (this.adapter == "cli") {
				return this.info ? this.round(value.ping.latency, 1) + "ms" : "0ms";
			} else {
				return this.round(value.latency, 2) + " ms";
			}
		},
		toBits(value) {
			return (value / (1024 * 1024)) * 8;
		},
		toMBytes(value) {
			return this.toBits(value) / (1024 * 1024);
		},
		round(value, places) {
			return parseFloat(value).toFixed(places);
		},
		loadSources() {
			fetch(`${this.publicPath}sources.json`)
				.then(json => json.json())
				.then(response => {
					this.sources = response;
					this.source = response[0].url;
					// this.loadStatus();
				})
				.catch(error => {
					this.error = error;
				});
		},
		loadStatus() {
			if (this.source) {
				if (
					this.source.includes("https://") ||
					this.source.includes("http://")
				) {
					// PUBLIC
					fetch(`${this.source}`)
						.then(json => json.json())
						.then(response => {
							this.info = response;
						})
						.catch(error => {
							this.error = error;
						});
				} else {
					// SAME DOMAIN
					fetch(`${this.publicPath}${this.source}`)
						.then(json => json.json())
						.then(response => {
							if (
								response.hasOwnProperty("LION") ||
								response.hasOwnProperty("SAFE")
							) {
								this.info = response;
								this.allCablesHealth();
							} else {
								this.error = "Missing key or something. check data source";
							}
						})
						.catch(error => {
							this.error = error;
						});
				}
			}
		},
		processLastUpdated(obj) {
			let selectedTimestamp = obj.LION.timestamp;
			let time = new Date(selectedTimestamp).toLocaleTimeString();
			let day =
				new Date().toLocaleDateString() ===
				new Date(selectedTimestamp).toLocaleDateString()
					? "Today, "
					: new Date(selectedTimestamp).toLocaleDateString();
			this.lastUpdate = `${day}, ${time}`;
		},
		calculateHealth(value) {
			const lowerLimit = 0;
			const upperLimit = 20;

			// let bandwidth = this.adapter === "cli" ? value.bandwidth : value;
			let valuePercentage;
			// console.log(value);

			if (this.adapter === "cli") {
				valuePercentage = (
					((this.toBits(value.bandwidth, 2) - lowerLimit) / upperLimit) *
					100
				).toFixed(1);
			} else {
				valuePercentage = ((parseInt(value) / upperLimit) * 100).toFixed(1);
			}

			// console.log(valuePercentage);

			if (this.info) {
				let health;
				if (valuePercentage > 80) {
					health = "healthy";
				} else if (valuePercentage > 30) {
					health = "degraded";
				} else if (valuePercentage > 10) {
					health = "offline";
				} else {
					health = "outage";
				}

				return health;
			} else {
				return "outage";
			}
		},
		allCablesHealth() {
			// TODO Should be rewritten to use cables from this.info instead of hardcoding

			if (typeof this.info.LION.download == "object") {
				this.adapter = "cli";
			} else {
				this.adapter = "api";
			}

			let MARS = document.getElementById("cable-MARS");
			let LION = document.getElementById("cable-LION");
			let SAFE1 = document.getElementById("cable-SAFE1");
			let SAFE2 = document.getElementById("cable-SAFE2");
			let SAFE3 = document.getElementById("cable-SAFE3");
			let METISS = document.getElementById("cable-METISS");
			MARS.classList = this.calculateHealth(this.info.MARS.download);
			LION.classList = this.calculateHealth(this.info.LION.download);
			SAFE1.classList = this.calculateHealth(this.info.SAFE1.download);
			SAFE2.classList = this.calculateHealth(this.info.SAFE2.download);
			SAFE3.classList = this.calculateHealth(this.info.SAFE3.download);
			METISS.classList = this.calculateHealth(this.info.METISS.download);

			// Update timestamp
			this.processLastUpdated(this.info);
		},
		hoverCable(cableName, state) {
			if (state) {
				document
					.getElementById("cable-" + cableName)
					.classList.add("highlight");
			} else {
				document
					.getElementById("cable-" + cableName)
					.classList.remove("highlight");
			}
		}
	},
	mounted() {
		this.loadStatus();
		this.loadSources();
	},
	watch: {
		source() {
			this.loadStatus();
		},
		info() {
			this.allCablesHealth();
		}
	}
};
</script>

